import React, { Component } from "react"
import Searchbar from "./Searchbar"

class App extends Component {
  constructor() {
    super()
    this.state = {}
  }
  render() {
    return (
      <div>
        <h1>Hello World</h1>
        <Searchbar />
      </div>
    )
  }
}
export default App
